import React, {Component} from 'react';

class Todo extends Component {
    giveId =() => {
        console.log(this.props.todo.complete)
        this.props.toggleComplete(this.props.todo.id)
    }
    render() {

        return (
            <div>

              <p style={{textDecoration: this.props.todo.complete? 'line-through': 'none'}} onClick={this.giveId}>  {this.props.todo.todo}</p>
            </div>
        );
    }
}

export default Todo;

